    - type: Paper
      content: >-
        Quick atmos brief:

        Your standard temperature is 293.15 K. Heater is already set.

        If it gets too hot just take the machine board out of the heater adjust it with a screw driver and put it back in.

        Right in front of oxygen tank there is a mixer, standar air composition is 21% oxygen 79% nitrogen. Oxygen is plugged into the "Primary port". Pressure is 101.325 kPa.

        In case of spacing the vents will lock themselves, after you deal with the breach just use your screwdriver to remove the pressure lock from the vent. In a locker in the other engineering room you can find tools to deal with spacings and hull breaches.

        Goodluck!
